import React from 'react';
import './App.css';
import ReactDOM from 'react'

function App() {
  return (
    <div className="App">
      <h1>We will create an awesome game with React, Redux, and SVG!</h1>
    </div>
  );
}

ReactDOM.render(
  <App/>
)


export default App;
